WITH filtered_date AS (SELECT d_date_sk FROM date_dim WHERE d_month_seq BETWEEN 1224 AND 1235), fact_agg AS (SELECT cs_warehouse_sk, cs_ship_mode_sk, cs_call_center_sk, cs_sold_date_sk, cs_ship_date_sk FROM catalog_sales INNER JOIN filtered_date ON cs_ship_date_sk = d_date_sk GROUP BY cs_warehouse_sk, cs_ship_mode_sk, cs_call_center_sk, cs_sold_date_sk, cs_ship_date_sk), join_warehouse AS (SELECT fa.cs_ship_mode_sk, fa.cs_call_center_sk, fa.cs_sold_date_sk, fa.cs_ship_date_sk, w.w_warehouse_name FROM fact_agg fa INNER JOIN warehouse w ON fa.cs_warehouse_sk = w.w_warehouse_sk), join_ship_mode AS (SELECT jw.cs_call_center_sk, jw.cs_sold_date_sk, jw.cs_ship_date_sk, jw.w_warehouse_name, sm.sm_type FROM join_warehouse jw INNER JOIN ship_mode sm ON jw.cs_ship_mode_sk = sm.sm_ship_mode_sk), join_call_center AS (SELECT js.cs_sold_date_sk, js.cs_ship_date_sk, js.w_warehouse_name, js.sm_type, cc.cc_name FROM join_ship_mode js INNER JOIN call_center cc ON js.cs_call_center_sk = cc.cc_call_center_sk), final_aggregate AS (SELECT substr(w_warehouse_name,1,20), sm_type, cc_name, sum(CASE WHEN (cs_ship_date_sk - cs_sold_date_sk <= 30) THEN 1 ELSE 0 END) AS "30 days", sum(CASE WHEN (cs_ship_date_sk - cs_sold_date_sk > 30) AND (cs_ship_date_sk - cs_sold_date_sk <= 60) THEN 1 ELSE 0 END) AS "31-60 days", sum(CASE WHEN (cs_ship_date_sk - cs_sold_date_sk > 60) AND (cs_ship_date_sk - cs_sold_date_sk <= 90) THEN 1 ELSE 0 END) AS "61-90 days", sum(CASE WHEN (cs_ship_date_sk - cs_sold_date_sk > 90) AND (cs_ship_date_sk - cs_sold_date_sk <= 120) THEN 1 ELSE 0 END) AS "91-120 days", sum(CASE WHEN (cs_ship_date_sk - cs_sold_date_sk > 120) THEN 1 ELSE 0 END) AS ">120 days" FROM join_call_center GROUP BY substr(w_warehouse_name,1,20), sm_type, cc_name) SELECT substr(w_warehouse_name,1,20), sm_type, cc_name, "30 days", "31-60 days", "61-90 days", "91-120 days", ">120 days" FROM final_aggregate ORDER BY substr(w_warehouse_name,1,20), sm_type, cc_name LIMIT 100